in the upper margin: 'S. Jacob der grösser.';
 in the right hand margin: 'Zebedei Son, / Johannis E= / uangelisten Bru / der, Von ste= / het Matthei iiij. / xvj. xxdj. Luce / diij. etc. Hat gele= / ret in Spanien, / Aber ist endlich / wider in Jude= / am komen. Und / dieweil er einen / grossen zufall be= / komen, ist im son= / derlich Abiathar / der Hohepriester / gram worden, / vnd durch prac= / tiken so viel zu / wege gebracht, / das er in als ei= / nen Auffrhürer / hat lassen einzie= / hen, vnd Herodt / Agrippe vberant / wortet, der hat / in entheubte las= / sen, Acto. xij.';
 in the lower margin: 'III. Der empfangen ist von dem heiligen Geist, Geboren aus / Marai der Jungfrawen.'

in the upper margin: 'S. Philippus.';
 in the right hand margin: 'AUch ein Ga= / lileer, Petri / v[n] Andree lands / man, Sein wird / gedacht, Johan. / J. VJ. xiiij. etc. / Vnd ist nicht der / Philippus, da= / uon Act. xxj. ste= / het, welcher nicht / ein Apostel, son= / dern einer aus / den vij. Diaken / gewesen ist. Er / sol in Scythia / xx. Jar gepredi= / get, vnd da viel / Wunderzeichen / gethan haben. / Danach sey er / gezogen in Asi= / am, seines alters / lxxxvij. Jar, Da / ist er gecreutziget / worden, wie Po= / lycrates schrei= / bet.';
 in the lower margin: 'V. Nidder gefaren zur Hellen, am dritten tage wider auffer= / standen von den Todten.'

- in the upper margin: 'S. Bartholomeus.';
 in the right hand margin: 'VOn diesem / finde ich, / das er in India / gepredigt habe. / Philaletus schrei / bet er habe des / Königs Polemij / Tochter gesund, / vnd den König / zum Christen ge= / macht, Die Gö= / tzen abgeworffen, / vnd das Chri= / stentumb gepflantzt. Derhal= / ben die Götzen= / priester sind ent= / rüstet worden, / haben schutz bey / des Königs bru= / der gesucht. Der / sol Bartholome= / um haben creu= / tzigen, vnd dar= / nach schinden, / vnd endlich köp= / ffen lassen.';
 in the lower margin: 'VI: Auffgefaren gen Himel, Sitzend zu der rechten Gottes des / Allmechtigen Vaters.'

- in the upper margin: 'S. Mattheus.';
 in the right hand margin: 'EIn Zölner, / Matthei ix. / Marc. ij. Luc. v. / Hat geprediget / inn Macedonia, / Egypto, vnd E= / thyopia, Vnd sol / sein Herberge ge= / habt haben zu / Radabar, bey / dem Kemmerer, / welchen Philip= / pus tauffte, Ac= / troum viij. Vnd / sol auch alda des / Königs son auff= / erweckt haben. / Als aber der Ko= / nig gestorben / war, hat Hirta= / cus die Tochter / habn, vnd das / Reich zu sich re= / ssen wollen. Da / aber Mattheus / solches widerra= / ten, hat Hirta= / cus im vber dem / Altar den Kopff / abhawen lassen.'; 
in the lower margin: 'VIII. Ich gleube an den heiligen Geist.'

- in the upper margin: 'S. Jacob der kleiner.';
 in the right hand margin: 'ALphei Son, / Simonis / vnd Jude bru= / der, ein heiliger / Man, Sein / wird gedacht / Gal. ij. Matth. / xxvij. Marci vij. / xv. Acto. xv. / Ist zu Jerusa= / lem blieben, vn[d] / hat alda geleret / xxx. jar. Ist vn= / ter dem Land= / pfleger Albino, / im vj. jar Nero= / nis, zu Jerusa= / lem von der / Canzel, vnd / aus dem Tem= / pel geworffen / vnd erschlagen / worden.';
 in the lower margin: 'IX. Eine heilige Christliche Kirche, die gemeine der heiligen.'

- in the upper margin: 'S. Simon.';
 in the right hand margin: 'At gepredi= / get in Egyp= / ten, Letzlich ist er / mit Juda inn / Persien komen, / vnd alda mit / zweien Zeube= / rern viel zu thun / gehabt, Bis jr / betrug durch die / Apostele ist of= / fenbar geworden, / da haben sie / müssen weichen, / vnd seind komen / gen Samnir, da / haben sie der / Götzen pfaffen / zugerichtet, das / sie beide Apo= / steln, als sie hin / kam, vnd pre= / digen wolten, / umbbracht ha= / ben.'; 
in the lower margin: 'X. Vergebung der Sünden.'

- in the upper margin: 'S. Judas Thadeus.';
 in the right hand margin: 'JUdas, Si= / mon, vnd / Jacobus, sind / Brüder gewest. / Vom Juda / schreibt Eusebi= / us, wie er nach Himelfart / Christi zum Kö / nig Abagaro / komen sey, vnd / alda Wunder= / zeichen gethan. / Hernach ist er / gerheiset in Me= / sopotamiam / vnd Pontum, / vnd alda gepre= / diget.';
 in the lower margin: 'XI. Aufferstehung des Fleisches.'

- in the upper margin: 'S. Matthias.';
 in the right hand margin: 'ISt erwehlet / worden an / Judas Ischari= / oth stat Acto. j. / Sol sein geboren / zu Bethlehem. / Hat gepredigt in / Judea, vnd gro= / sse Zeichen ge= / than. Darumb / haben in die Jü= / den durch falsch / gezeugnis, vom / leben bracht, / Vnd man schrei= / bet, im sey der / Kopff mit einem / Fallbeil, nach Rö / mischer weis ab= / gehawen wor= / den.';
in the lower margin: 'XII. Vnd ein ewiges Leben, Amen.'
